package com.basic;

public class RemainderofNum {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num1,num2,rem,qt;
		num1=1089;
		num2=33;
		qt=num1/num2;
		rem=num1%num2;
		System.out.println("Quotient is: "+qt);
		System.out.println("Remainder is: "+rem);
		

	}

}
